      uint y2;
  }

  Line[] allLines;

  function draw(uint _x1, uint _x2, uint _y1, uint _y2) external{
    allLines.push(Line(msg.sender,_x1, _x2, _y1, _y2));
  }

  function returnStruct(uint index)public view returns(Line memory){
      return allLines[index];
  }
}

